import React, { useEffect, useState, useContext } from 'react'
import { connect } from 'react-redux'
import { increment, decrement, reset } from './actionCreators'

import axios from 'axios'
import { Context } from '../pages/Store'

const Blog = () => {
  const [state, dispatch] = useContext(Context)

  useEffect(() => {
    axios
      .get('https://ws.med.tn/web/doctorInfos/?api_key=drmateri')
      .then(response => {
        console.log('88888888888', Object.values(response)[0])
        dispatch({
          type: 'SET_POSTS',
          payload: Object.values(response)[0],
        })
      })
      .catch(error => {
        dispatch({ type: 'SET_ERROR', payload: error })
      })
  }, [])

  let posts = <p>Loading...</p>

  if (state.error) {
    posts = (
      <p>
        Something went wrong: <span>{state.error}</span>
      </p>
    )
  }

  if (!state.error && state.posts) {
    console.log('posts', state.posts[0] && state.posts[0].diploma)
    return <a>{state.posts[0] && state.posts[0].diploma}</a>
  }
  return { posts }
}

export default Blog
